import './App.css';
import post from './post';
import Header from './Header';
import {Routes} from "react"

function App() {
  return (

    <Routes>
       <Route index element={
        <main>
        <Header/>
        <post/>
        <post/>
        <post/>  
        </main>
       } /> 
       </Routes>

  );
}

export default App;
